{
    "env": {
        "browser": true
    },
    "extends": "eslint:recommended",
    "rules": {
        "indent": [
            "error",
            4
        ],
        "linebreak-style": [
            "error",
            "unix"
        ],
        "quotes": "off",
        "semi": [
            "error",
            "always"
        ]
    }
}

#!/usr/bin/env groovy

pipeline {
    agent { label 'GEITENPETRA' }
    options { disableConcurrentBuilds() }

    stages {
        stage('Build') {
            steps {
                withPythonEnv('System-CPython-3.10') {
                    withEnv(['DATABASE_USER=django_oscar', 'DATABASE_PASSWORD=django_oscar', 'DATABASE_PORT=5432', 'DATABASE_HOST=localhost']) {
                        pysh "make install"
                    }
                }
            }
        }
        stage('Lint') {
            steps {
                withPythonEnv('System-CPython-3.10') {
                    pysh "make lint"
                }
            }
        }
        stage('Test') {
            steps {
                withPythonEnv('System-CPython-3.10') {
                    withEnv(['DATABASE_USER=django_oscar', 'DATABASE_PASSWORD=django_oscar', 'DATABASE_PORT=5432', 'DATABASE_HOST=localhost']) {
                        pysh "make test"
                    }
                }
            }
            post {
                always {
                    junit allowEmptyResults: true, testResults: '**/nosetests.xml'
                }
                success {
                    echo "kek!"
                    // step([
                    //     $class: 'CoberturaPublisher',
                    //     coberturaReportFile: '**/coverage.xml',
                    // ])
                }
            }
        }
    }
    post {
        always {
            echo 'This will always run'
        }
        success {
            echo 'This will run only if successful'
            withPythonEnv('System-CPython-3.10') {
                echo 'This will run only if successful'
                pysh "version --plugin=wheel -B${env.BUILD_NUMBER} --skip-build"
                sh "which git"
                sh "git push --tags"
            }
        }
        failure {
            emailext subject: "JENKINS-NOTIFICATION: ${currentBuild.currentResult}: Job '${env.JOB_NAME} #${env.BUILD_NUMBER}'",
                    body: '${SCRIPT, template="groovy-text.template"}',
                    recipientProviders: [culprits(), brokenBuildSuspects(), brokenTestsSuspects()]

        }
        unstable {
            echo 'This will run only if the run was marked as unstable'
        }
        changed {
            echo 'This will run only if the state of the Pipeline has changed'
            echo 'For example, if the Pipeline was previously failing but is now successful'
        }
    }
}

{
  "name": "django-oscar",
  "description": "Django Oscar sandbox site",
  "env": {
    "ALLOWED_HOSTS": {
      "required": true
    },
    "SECRET_KEY": {
      "required": true
    },
    "SECURE_SSL_REDIRECT": {
      "required": true
    }
  },
  "formation": {
    "web": {
      "quantity": 1,
      "size": "free"
    }
  },
  "stack": "container"
}

